            <div class="article-text"><h3 class="article-desc fw-bold" style="font-size: 1.25em"><no>2</no> 제관선정</h3> 
                <p class="article-desc">제관은 정월 초이레에 마을 이장과 노인들이 주관하여
                    생기복덕을 가려 선정한다.</p></div> 
